import React from 'react';
import './App.css'; // Import CSS for styling
import ShowReelForm from './components/ShowReelForm';
import ShowReelList from './components/ShowReelList';
import VideoClipForm from './components/VideoClipForm';
import VideoClipList from './components/VideoClipList';

const App = () => {
  return (
    <div className="container">
      <header>
        <h1>Show Reel Application</h1>
      </header>
      <section className="show-reel-section">
        <h2>Create New Show Reel</h2>
        <ShowReelForm />
      </section>
      <section className="show-reel-section">
        <h2>Show Reels</h2>
        <ShowReelList />
      </section>
      <section className="video-clip-section">
        <h2>Add Video Clip</h2>
        <VideoClipForm />
      </section>
      <section className="video-clip-section">
        <h2>Video Clips</h2>
        <VideoClipList />
      </section>
    </div>
  );
};

export default App;
